import React, { Component } from "react";

class UserItem extends Component {
  state = {
    login: "shaniaf",
  };
  render() {
    return (
      <div>
        <h3>shani</h3>
        <h2>this.state.login</h2>
      </div>
    );
  }
}

export default UserItem;
